import { imageUrl } from "../utils/imageUrl.mjs";


const Champions = (props) => {
    const {champions, selectedChampions} = props;
    return (
        <div>
            {champions.map((champion, index) => (
            <div onClick={selectedChampions} key={index} id={champion} className="champion" style={{backgroundImage: `url(${imageUrl(champion)})`}}></div>           
            ))}
        </div>
  )
}

export default Champions
